import React, { Component } from 'react';


export default class UserSystem extends Component {
    logOut(e){
        e.preventDefault()
        localStorage.removeItem('usertoken')
        this.props.history.push('/')
    }

    render() {
        return (
            <div>
                <h1>this is the page for user system display</h1>
            </div>
        );
    }
}
